Improve archer, strengthen wall, learn magic and protect your base from the invasion of thousands of opponents.

-4 ways of progress - choose 9 of 13 super skills and make their own, unique shooter.
-5 defensive fortifications and traps - create a secure rear
-3 types of magic to influence the course of the battle - specifically attacking , defensive and mass - each contains 3 spells.
-More than 20 types of enemies with unique behaviors, including wizards , which strengthens its allies.
-250 original levels, daily gifts and 2 game modes for real gamers.
-Defeat BOSSes , earn achievments and show enemies who's the boss!

